    const user = useSelector(store => store.userData.userOnline)
    const allTodos = useSelector(store => store.taskData.todos) 

    const myTodos = allTodos.filter(item => item.filterID === user.id)

    console.log(allTodos);
    console.log(user);

    return(
        <>
        {
            myTodos.length
            ? myTodos.map(task => {
            return(
            <label key={task.filterID}><input type='checkbox' /> <p className=''>{task.text}</p></label>
            )
                })
            : <h3>Нет задач</h3>
        }





        </>
    )
}

